ústria de la tipografia i la impremta. Lorem Ipsum ha estat el text estàndard de la indústria des de l\'any 1500, quan un impressor desconegut va fer servir una galerada de text i la va mesclar per crear un llibre de mostres tipogràfiques. No només ha sobreviscut cinc segles, sinó que ha fet el salt cap a la creació de tipus de lletra electrònics, romanent essencialment sense canvis. Es va popularitzar l\'any 1960 amb el llançament de fulls Letraset que contenien passatges de Lorem Ipsum, i més recentment amb programari d\'autoedició com Aldus Pagemaker que inclou versions de Lorem Ipsum.\nHrvatski\nLorem Ipsum je jednostavno probni tekst koji se koristi u tiskarskoj i slovoslagarskoj industriji. Lorem Ipsum postoji kao industrijski standard još od 16-og stoljeća, kada je nepoznati tiskar uzeo tiskarsku galiju slova i posložio ih da bi napravio knjigu s uzorkom tiska. Taj je tekst ne samo preživio pet stoljeća, već se i vinuo u svijet elektronskog slovoslagarstva, ostajući u suštini nepromijenjen. Postao je popularan tijekom 1960-ih s pojavom Letraset listova s odlomcima Lorem Ipsum-a, a u skorije vrijeme sa software-om za stolno izdavaštvo kao što je Aldus PageMaker koji također sadrži varijante Lorem Ipsum-a.\nČesky\nLorem Ipsum je demonstrativní výplňový text používaný v tiskařském a knihařském průmyslu. Lorem Ipsum je považováno za standard v této oblasti už od začátku 16. století, kdy dnes neznámý tiskař vzal kusy textu a na jejich základě vytvořil speciální vzorovou knihu. Jeho odkaz nevydržel pouze pět století, on přežil i nástup elektronické sazby v podstatě beze změny. Nejvíce popularizováno bylo Lorem Ipsum v šedesátých letech 20. století, kdy byly vydávány speciální vzorníky s jeho pasážemi a později pak díky počítačovým DTP programům jako Aldus PageMaker.\nRomâna\nLorem Ipsum este pur şi simplu o machetă pentru text a industriei tipografice. Lorem Ipsum a fost macheta standard a industriei încă din secolul al XVI-lea, când un tipograf anonim a luat o planşetă de litere şi le-a amestecat pentru a crea o carte demonstrativă pentru literele respective. Nu doar că a supravieţuit timp de cinci secole, dar şi a facut saltul în tipografia electronică practic neschimbată. A fost popularizată în anii \'60 odată cu ieşirea colilor Letraset care conţineau pasaje Lorem Ipsum, iar mai recent, prin programele de publicare pentru calculator, ca Aldus PageMaker care includeau versiuni de Lorem Ipsum.\nСрпски\nLorem Ipsum је једноставно модел текста који се користи у штампарској и словослагачкој индустрији. Lorem ipsum је био стандард за модел текста још од 1500. године, када је непознати штампар узео кутију са словима и сложио их како би направио узорак књиге. Не само што је овај модел опстао пет векова, него је чак почео да се користи и у електронским медијима, непроменивши се. Популаризован је шездесетих година двадесетог века заједно са листовима летерсета који су садржали Lorem Ipsum пасусе, а данас са софтверским пакетом за прелом као што је Aldus PageMaker који је садржао Lorem Ipsum верзије.','Lorem Ipsum','','publish','closed','closed','','lorem-ipsum','','','2007-09-04 09:52:50','2007-09-04 16:52:50','',0,'https://wpthemetestdata.wordpress.com/lorem-ipsum/',7,'page','',0),(155,1,'2007-09-04 10:47:47','2007-09-04 17:47:47','Repository-hosted Themes are required to support display of comments on static Pages as well as on single blog Posts.  This static Page has comments, and these comments should be displayed.\nIf the Theme includes a custom option to prevent static Pages from displaying comments, such option must be disabled (i.e. so that static Pages display comments) by default.\nAlso, verify that this Page does not display taxonomy information (e.g. categories or tags) or time-stamp information (Page publish date/time).','Page with comments','','publish','open','closed','','page-with-comments','','','2007-09-04 10:47:47','2007-09-04 17:47:47','',33,'https://wpthemetestdata.wordpress.com/page-with-comments/',3,'page','',3),(156,1,'2007-09-04 10:48:10','2007-09-04 17:48:10','This static Page is set not to allow comments. Verify that the Page does not display a comment list, comment reply links, or comment reply form.\nAlso, verify that the Page does not display a \"comments are closed\" type message. Such messages are not suitable for static Pages, and should only be used on blog Posts.','Page with comments disabled','','publish','closed','closed','','page-with-comments-disabled','','','2007-09-04 10:48:10','2007-09-04 17:48:10','',33,'https://wpthemetestdata.wordpress.com/page-with-comments-disabled/',4,'page','',0),(172,1,'2007-12-11 16:23:16','2007-12-11 06:23:16','Level 3 of the reverse hierarchy test.','Level 3','','publish','closed','closed','','level-3','','','2007-12-11 16:23:16','2007-12-11 06:23:16','',173,'https://wpthemetestdata.wordpress.com/level-3/',0,'page','',0),(173,1,'2007-12-11 16:23:33','2007-12-11 06:23:33','Level 2 of the reverse hierarchy test.','Level 2','','publish','closed','closed','','level-2','','','2007-12-11 16:23:33','2007-12-11 06:23:33','',174,'https://wpthemetestdata.wordpress.com/level-2/',0,'page','',0),(174,1,'2007-12-11 16:25:40','2007-12-11 23:25:40','Level 1 of the reverse hierarchy test.  This is to make sure the importer correctly assigns parents and children even when the children come first in the export file.','Level 1','','publish','closed','closed','','level-1','','','2019-12-17 07:03:41','2019-12-17 07:03:41','',0,'https://wpthemetestdata.wordpress.com/level-1/',5,'page','',0),(358,1,'2010-10-05 00:27:25','2010-10-05 07:27:25','All children, except one, grow up. They soon know that they will grow up, and the way Wendy knew was this. One day when she was two years old she was playing in a garden, and she plucked another flower and ran with it to her mother. I suppose she must have looked rather delightful, for Mrs. Darling put her hand to her heart and cried, \"Oh, why can\'t you remain like this for ever!\" This was all that passed between them on the subject, but henceforth Wendy knew that she must grow up. You always know after you are two. Two is the beginning of the end.\n<!--more-->\nMrs. Darling first heard of Peter when she was tidying up her children\'s minds. It is the nightly custom of every good mother after her children are asleep to rummage in their minds and put things straight for next morning, repacking into their proper places the many articles that have wandered during the day.\nIf you could keep awake (but of course you can\'t) you would see your own mother doing this, and you would find it very interesting to watch her. It is quite like tidying up drawers. You would see her on her knees, I expect, lingering humorously over some of your contents, wondering where on earth you had picked this thing up, making discoveries sweet and not so sweet, pressing this to her cheek as if it were as nice as a kitten, and hurriedly stowing that out of sight. When you wake in the morning, the naughtiness and evil passions with which you went to bed have been folded up small and placed at the bottom of your mind and on the top, beautifully aired, are spread out your prettier thoughts, ready for you to put on.\nI don\'t know whether you have ever seen a map of a person\'s mind. Doctors sometimes draw maps of other parts of you, and your own map can become intensely interesting, but catch them trying to draw a map of a child\'s mind, which is not only confused, but keeps going round all the time. There are zigzag lines on it, just like your temperature on a card, and these are probably roads in the island, for the Neverland is always more or less an island, with astonishing splashes of colour here and there, and coral reefs and rakish-looking craft in the offing, and savages and lonely lairs, and gnomes who are mostly tailors, and caves through which a river runs, and princes with six elder brothers, and a hut fast going to decay, and one very small old lady with a hooked nose. It would be an easy map if that were all, but there is also first day at school, religion, fathers, the round pond, needle-work, murders, hangings, verbs that take the dative, chocolate pudding day, getting into braces, say ninety-nine, three-pence for pulling out your tooth yourself, and so on, and either these are part of the island or they are another map showing through, and it is all rather confusing, especially as nothing will stand still.\nOf course the Neverlands vary a good deal. John\'s, for instance, had a lagoon with flamingoes flying over it at which John was shooting, while Michael, who was very small, had a flamingo with lagoons flying over it. John lived in a boat turned upside down on the sands, Michael in a wigwam, Wendy in a house of leaves deftly sewn together. John had no friends, Michael had friends at night, Wendy had a pet wolf forsaken by its parents, but on the whole the Neverlands have a family resemblance, and if they stood still in a row you could say of them that they have each other\'s nose, and so forth. On these magic shores children at play are for ever beaching their coracles [simple boat]. We too have been there; we can still hear the sound of the surf, though we shall land no more.\nOf all delectable islands the Neverland is the snuggest and most compact, not large and sprawly, you know, with tedious distances between one adventure and another, but nicely crammed. When you play at it by day with the chairs and table-cloth, it is not in the least alarming, but in the two minutes before you go to sleep it becomes very real. That is why there are night-lights.\nOccasionally in her travels through her children\'s minds Mrs. Darling found things she could not understand, and of these quite the most perplexing was the word Peter. She knew of no Peter, and yet he was here and there in John and Michael\'s minds, while Wendy\'s began to be scrawled all over with him. The name stood out in bolder letters than any of the other words, and as Mrs. Darling gazed she felt that it had an oddly cocky appearance.','Post Format: Standard','','publish','closed','closed','','post-format-standard','','','2010-10-05 00:27:25','2010-10-05 07:27:25','',0,'https://wpthemetestdata.wordpress.com/?p=358',0,'post','',0),(501,1,'2010-08-01 09:42:26','2010-08-01 16:42:26','The last item in this page\'s content is a thumbnail floated left. There should be page links following it. Make sure any elements after the content are clearing properly.\n  The float is cleared when it does not stick out the bottom of the parent container, and when other elements that follow it do not wrap around the floated element.\n<img class=\"alignleft size-thumbnail wp-image-827\" title=\"Camera\" src=\"http://localhost/wp-content/uploads/2012/07/manhattansummer.jpg?w=150\" alt=\"\" width=\"160\" /> <!--nextpage-->This is the second page','Clearing Floats','','publish','closed','closed','','clearing-floats','','','2010-08-01 09:42:26','2010-08-01 16:42:26','',33,'https://wpthemetestdata.wordpress.com/',2,'page','',0),(555,1,'2010-09-10 07:24:14','2010-09-10 14:24:14','[gallery]\n<!--nextpage-->\nYou can use this page to test the Theme\'s handling of the[gallery]\nshortcode, including the <code>columns</code> parameter, from 1 to 9 columns. Themes are only required to support the default setting (3 columns), so this page is entirely optional.\n<h2>One Column</h2>\n[gallery columns=\"1\"]\n<h2>Two Columns</h2>\n[gallery columns=\"2\"]\n<h2>Three Columns</h2>\n[gallery columns=\"3\"]\n<h2>Four Columns</h2>\n[gallery columns=\"4\"]\n<h2>Five Columns</h2>\n[gallery columns=\"5\"]\n<h2>Six Columns</h2>\n[gallery columns=\"6\"]\n<h2>Seven Columns</h2>\n[gallery columns=\"7\"]\n<h2>Eight Columns</h2>\n[gallery columns=\"8\"]\n<h2>Nine Columns</h2>\n[gallery columns=\"9\"]','Post Format: Gallery','','publish','closed','closed','','post-format-gallery','','','2010-09-10 07:24:14','2010-09-10 14:24:14','',0,'https://wpthemetestdata.wordpress.com/?p=555',0,'post','',0),(559,1,'2010-05-09 07:51:54','2010-05-09 14:51:54','“I never tried to prove nothing, just wanted to give a good show. My life has always been my music, it\'s always come first, but the music ain\'t worth nothing if you can\'t lay it on the public. The main thing is to live for that audience, \'cause what you\'re there for is to please the people.”','Post Format: Aside','','publish','closed','closed','','post-format-aside','','','2010-05-09 07:51:54','2010-05-09 14:51:54','',0,'https://wpthemetestdata.wordpress.com/?p=559',0,'post','',0),(562,1,'2010-01-08 07:59:31','2010-01-08 14:59:31','Abbott: Strange as it may seem, they give ball players nowadays very peculiar names.\nCostello: Funny names?\nAbbott: Nicknames, nicknames. Now, on the St. Louis team we have Who\'s on first, What\'s on second, I Don\'t Know is on third--\nCostello: That\'s what I want to find out. I want you to tell me the names of the fellows on the St. Louis team.\nAbbott: I\'m telling you. Who\'s on first, What\'s on second, I Don\'t Know is on third--\nCostello: You know the fellows\' names?\nAbbott: Yes.\nCostello: Well, then who\'s playing first?\nAbbott: Yes.\nCostello: I mean the fellow\'s name on first base.\nAbbott: Who.\nCostello: The fellow playin\' first base.\nAbbott: Who.\nCostello: The guy on first base.\nAbbott: Who is on first.\nCostello: Well, what are you askin\' me for?\nAbbott: I\'m not asking you--I\'m telling you. Who is on first.\nCostello: I\'m asking you--who\'s on first?\nAbbott: That\'s the man\'s name.\nCostello: That\'s who\'s name?\nAbbott: Yes.\nCostello: When you pay off the first baseman every month, who gets the money?\nAbbott: Every dollar of it. And why not, the man\'s entitled to it.\nCostello: Who is?\nAbbott: Yes.\nCostello: So who gets it?\nAbbott: Why shouldn\'t he? Sometimes his wife comes down and collects it.\nCostello: Who\'s wife?\nAbbott: Yes. After all, the man earns it.\nCostello: Who does?\nAbbott: Absolutely.\nCostello: Well, all I\'m trying to find out is what\'s the guy\'s name on first base?\nAbbott: Oh, no, no. What is on second base.\nCostello: I\'m not asking you who\'s on second.\nAbbott: Who\'s on first!\nCostello: St. Louis has a good outfield?\nAbbott: Oh, absolutely.\nCostello: The left fielder\'s name?\nAbbott: Why.\nCostello: I don\'t know, I just thought I\'d ask.\nAbbott: Well, I just thought I\'d tell you.\nCostello: Then tell me who\'s playing left field?\nAbbott: Who\'s playing first.\nCostello: Stay out of the infield! The left fielder\'s name?\nAbbott: Why.\nCostello: Because.\nAbbott: Oh, he\'s center field.\nCostello: Wait a minute. You got a pitcher on this team?\nAbbott: Wouldn\'t this be a fine team without a pitcher?\nCostello: Tell me the pitcher\'s name.\nAbbott: Tomorrow.\nCostello: Now, when the guy at bat bunts the ball--me being a good catcher--I want to throw the guy out at first base, so I pick up the ball and throw it to who?\nAbbott: Now, that\'s he first thing you\'ve said right.\nCostello: I DON\'T EVEN KNOW WHAT I\'M TALKING ABOUT!\nAbbott: Don\'t get excited. Take it easy.\nCostello: I throw the ball to first base, whoever it is grabs the ball, so the guy runs to second. Who picks up the ball and throws it to what. What throws it to I don\'t know. I don\'t know throws it back to tomorrow--a triple play.\nAbbott: Yeah, it could be.\nCostello: Another guy gets up and it\'s a long ball to center.\nAbbott: Because.\nCostello: Why? I don\'t know. And I don\'t care.\nAbbott: What was that?\nCostello: I said, I DON\'T CARE!\nAbbott: Oh, that\'s our shortstop!','Post Format: Chat','','publish','closed','closed','','post-format-chat','','','2010-01-08 07:59:31','2010-01-08 14:59:31','',0,'https://wpthemetestdata.wordpress.com/?p=562',0,'post','',0),(565,1,'2010-03-07 08:06:53','2010-03-07 15:06:53','<a href=\"https://make.wordpress.org/themes\" title=\"The WordPress Theme Review Team Website\">The WordPress Theme Review Team Website</a>','Post Format: Link','','publish','closed'