tem</li>\n</ul>\n</li>\n</ul>\n</li>\n	<li>ordered item</li>\n	<li>ordered item</li>\n</ol>\n<h3>Unordered - Ordered - Unordered</h3>\n<ul>\n	<li>unordered item</li>\n	<li>unordered item\n<ol>\n	<li>ordered</li>\n	<li>ordered\n<ul>\n	<li>unordered item</li>\n	<li>unordered item</li>\n</ul>\n</li>\n</ol>\n</li>\n	<li>unordered item</li>\n	<li>unordered item</li>\n</ul>\n<h3>Unordered - Unordered - Ordered</h3>\n<ul>\n	<li>unordered item</li>\n	<li>unordered item\n<ul>\n	<li>unordered</li>\n	<li>unordered\n<ol>\n	<li><strong>ordered item</strong></li>\n	<li><strong>ordered item</strong></li>\n</ol>\n</li>\n</ul>\n</li>\n	<li>unordered item</li>\n	<li>unordered item</li>\n</ul>','Edge Case: Nested And Mixed Lists','','publish','closed','closed','','edge-case-nested-and-mixed-lists','','','2009-05-15 14:48:32','2009-05-15 21:48:32','',0,'http://wptest.io/demo/?p=1000',0,'post','',0),(1011,1,'2012-03-15 15:15:12','2012-03-15 22:15:12','This post should display a <a title=\"Featured Images\" href=\"https://en.support.wordpress.com/featured-images/#setting-a-featured-image\" target=\"_blank\" rel=\"noopener noreferrer\">featured image</a>, if the theme <a title=\"Post Thumbnails\" href=\"https://codex.wordpress.org/Post_Thumbnails\" target=\"_blank\" rel=\"noopener noreferrer\">supports it</a>.\nNon-square images can provide some unique styling issues.\nThis post tests a horizontal featured image.','Template: Featured Image (Horizontal)','','publish','closed','closed','','template-featured-image-horizontal','','','2012-03-15 15:15:12','2012-03-15 22:15:12','',0,'http://wptest.io/demo/?p=1011',0,'post','',0),(1016,1,'2012-03-15 15:36:32','2012-03-15 22:36:32','This post should display a <a title=\"Featured Images\" href=\"https://en.support.wordpress.com/featured-images/#setting-a-featured-image\" target=\"_blank\" rel=\"noopener noreferrer\">featured image</a>, if the theme <a title=\"Post Thumbnails\" href=\"https://codex.wordpress.org/Post_Thumbnails\" target=\"_blank\" 